import React from 'react'

const RandomButton = () => {
  return (
    <button className="nav-btn" id="randomBtn">
      Random
    </button>
  )
}

const PreviousButton = () => {
  return (
    <button className="nav-btn" id="prevBtn">
      Previous
    </button>
  )
}

const NextButton = () => {
  return (
    <button className="nav-btn" id="nextBtn">
      Next
    </button>
  )
}

export {RandomButton, PreviousButton, NextButton}
